import React from 'react';
import Link from '@material-ui/core/Link';
import { LinkedIn, YouTube, Facebook, Email } from '@material-ui/icons';

const Footer = () => {
    const preventDefault = (event) => event.preventDefault();

    return (
        <div className="footer">
            <Link href="https://www.linkedin.com/in/albertobelalcazar/" target="_blank" onClick={preventDefault} color="inherit">
                <LinkedIn style={{ fontSize: 70 }} />
            </Link>
            <Link href="https://www.youtube.com/c/KreaMegas/about" target="_blank" onClick={preventDefault} color="inherit">
                <YouTube style={{ fontSize: 70 }} />
            </Link>
            <Link href="mailto:info@alberto.codes" target="_blank" onClick={preventDefault} color="inherit">
                <Email style={{ fontSize: 70 }} />
            </Link>
        </div>
    );
};

export default Footer;
